　JACKALL/ジャッカル　メバル節　２インチ<br />◆サイズ：2インチ<br />◆入り数：15本<br />★魚の好む味とニオイを配合したピンテールストレートワーム「メバル節」が登場！最大の特徴はボディに設けられた「節」で、各節が水を捉え細身のボディでも水押し感は抜群です。また、頭からカットして「寸ずめ」にしてもテール部分のボリューム感が損なわれないので、対象魚が小型の場合は是非お試しください。<style>
