ライトリグ専用設計の「タイニーイカ」。現在はアメリカでも発売されていますが、元々は日本のトーナメンターの要望から生まれた製品です。よって、ハイプレッシャーレイクでのライトリグを主要用途としてデザインされています。<br><br> 　その特徴は、イカシリーズ中最小の一口サイズ、フラスカートさえもライトリグ対応の本体一体成型の「Tentacle Skirt」を採用。フレアー感に優れた従来のフラスカートとは異なり、自然ななびき・微妙なロッドワークにも機敏に反応するレスポンスを重視、ジグヘッドリグやダウンショットリグといったフィネスワーミングに高次元で対応します。<hr>全長:約７ｃｍ<hr>自重:約１．４ｇ<hr>適合フックサイズ:＃４～２、マスバリ等<hr>２０本入<style>
